                    dp[i][j] += dp[i-1][j-1] + 1

                # right up
                if i > 0 and j < n - 1:
                    dp[i][j] += dp[i-1][j+1] + 1

                # down left
                if i < m - 1 and j > 0:
                    dp[i][j] += dp[i+1][j-1] + 1

                # down right
                if i < m - 1 and j < n - 1:
